import React, { Component } from 'react';

import './App.scss';

function App() {
  return (
    <div className="container-fluid">
      <div className='row'>
        <div className='col-md-2'>Hello</div>
        <div className='col-md-10'>World!</div>
      </div>
      <div className='row'>
        <div className='col-md-2'>
          <ul>
            <li>
            <Link to="https://example.zendesk.com/hc/en-us/articles/123456789-Privacy-Policies" target="_blank">Podcasts</Link>
            </li>
          </ul>
        </div>
        <div className='col-md-10'>World!</div>
      </div>
    </div>
  );
}

export default App;
